import notes from "../notes";
var [newNotes , setNewNotes] = useState([{title:" " , content: "" }]);

function Note(){
    return (notes.map(noteEntry=>{
         return(<div className = "note">
        <h1>{noteEntry.title}</h1>
        <p>{noteEntry.content}</p>
        <button>delete</button>
    </div>);
    }));
    
}

export default Note ;
